INSERT INTO `outlet_descriptions` (`id`, `full_description`, `summary`, `created_at`, `updated_at`)
VALUES
	(1,'As its name so aptly suggests, S & N Spa Pte Ltd, which was first established in 2003, is set to provide you with gorgeous pampering that will see your body re-energized and your mind refreshed. Conveniently located in the recently opened 488 Changi Road, this CaseTrust accredited beauty centre is incredibly easy to reach and staffed with trained professionals with ample experience in the beauty and wellness industry.','Seek refuge in the calming retreat that we offer at S&N Spa and try out our various massage services that will leave you feeling refreshed and rejuvenated!','2015-02-26 02:23:00','2015-03-24 06:45:07'),
	(2,'Escape the stress and monotony of everyday life with a visit to Tang Dynasty Spa, and indulge yourself in a luxurious Oriental boutique spa experience at affordable prices.\r\n\r\nFirst opened in 2011 at North Bridge Road, the spa successfully expanded to its second branch at Bukit Timah. Here you can enjoy treatment rooms equipped with soft padded beds and private shower cubicles in a beautiful, serene environment. Our customized Oriental massage treatments are carried out by certified Therapists, expert at making you feel as relaxed and comfortable as possible as they knead away the knots and tensions in your body. In the Relaxation Lounge, our Foot Reflexology specialists will also pamper you as you sit back in your armchair while enjoying free wifi and entertainment system. The skills and experience of our therapists combined with their warm and caring personalities, will make sure you rest, relax and rejuvenate fully.\r\n\r\nTang Dynasty Spa is fully committed to providing professional, high-quality service and cleanliness with excellent value. We look forward to serving you with the royal treatment you deserve from head to toes.','Escape the stress and monotony of everyday life with a visit to Tang Dynasty Massage & Spa, and indulge yourself in a luxurious Oriental boutique spa experience at affordable prices. Tang Dynasty Spa is fully committed to providing professional, high-quality service and cleanliness with excellent value. We are open 24 hours, giving you access to a sanctuary of bliss anytime you want around the clock. We look forward to serving you with the royal treatment you deserve from head to toes.','2015-02-26 02:23:00','2015-03-22 08:44:18'),
	(3,'The one stop centre beauty salon dedicated to consistently providing high customers satisfaction by rendering superior personal attention and service, Beautti Slim offers a wide variety of beauty services that are catered to every individuals needs. The salon is committed to enhance their clients appearance with their procurement of highly qualified beauticians and latest equipment provided. Enjoying a full-fledged wellness and mental state of relaxation at the calming atmosphere at acceptable prices and overvalued relationships. \r\n\r\nFor 60 min Full Body Massage, choose 1 from 3 types:\r\nJamu Massage - traditional Javanese reflexology which uses Jamu herbs\r\nSwiss Massage - a relaxing massage that reduces stress\r\nMeridian Infusion Massage - with 5 elements organic oil to balance harmony and health\r\nFor Body Treat, choose 1 from 4 types:\r\nUpper Back Guasha - reduces heatiness and restores normal metabolic processes in the body\r\nHerbal Foot Bath - softens calluses and deodourises soles, relax or invigorate tired feet\r\nHerbal Steam (for female customers only) - reduces water retention, soothes body and mind using steam and essential herbs\r\nBack Cupping - reduces heatiness and draws out toxins out of the body for a cleaner intestinal system\r\nSkilled, experienced therapists\r\nAvailable at 2 convenient locations within walking distance from MRT stations\r\n\r\nOperating Hours\r\n\r\nMonday to Friday: 11am - 9.30pm \r\nSaturday: 10am - 7pm \r\nSunday: 10am - 4pm (Ngee Ann City) \r\nSunday: 11am - 5pm (HarbourFront Centre)','Youth is happy because it has the capacity to see beauty. Anyone who keeps the ability to see beauty never grows old','2015-03-24 06:53:05','2015-03-24 06:53:05');
