INSERT INTO `service_conditions` (`id`, `special_condition`, `condition1`, `condition2`, `created_at`, `updated_at`)
VALUES
	(1,'<p>Fine Print</p>\r\n\r\n<ul>\r\n	<li><strong>Valid till 23 Jun 2015</strong></li>\r\n	<li><strong>Limit 1 Groupon per person</strong></li>\r\n	<li>Valid for customers 23 years and above</li>\r\n	<li>Valid for Singaporeans, PRs, EP and DP holders</li>\r\n	<li>Valid for first time facial customers at Spa Symphony and those who have not visited in the past 12 months</li>\r\n	<li>Not valid for existing package holders</li>\r\n	<li>Max. 3 pax per slot</li>\r\n</ul>\r\n','<p>&nbsp;</p>\r\n\r\n<ul>\r\n</ul>\r\n\r\n<p>Punctuality : Please arrive at the spa at least 15 minutes before the appointment time. Late arrival may result in shortening of the treatment time, as the spa needs to cater to the next customer. Should you be expected to be late, please contact the spa consultant earlier so that appropriate adjustment may be made. Please note that for all appointments made, the spa will wait for the customer for a maximum of 15 mins from the appointment time. Beyond that, the spa will give the slot up for other customers. Thus please help by contacting us at least half an hour before, should you be late for the appointment or wish to cancel it.</p>\r\n','<ul>\r\n	<li>\r\n	<h3>Redemption Instructions</h3>\r\n	</li>\r\n	<li><strong>Appointment required</strong></li>\r\n	<li>Call 6636 8878, SMS 9035 8833 or email<a href=\"mailto:313@spasymphony.com.sg\" target=\"_blank\">313@spasymphony.com.sg</a>&nbsp;and quote &#39;Groupon promotion&#39;</li>\r\n	<li><strong>Valid ID MUST be presented</strong></li>\r\n	<li>Cancellations and amendments allowed at least 1 day in advance</li>\r\n</ul>\r\n','2015-02-26 02:23:00','2015-03-24 01:33:23'),
	(2,'<p>Appointment Booking : To help the spa better schedule our appointments so that you can have your desired time slot and therapist, we recommend that our customers contact us at least 3 days before their preferred treatment date. While we may not be able to guarantee that we can accommodate your desired slot, we will do our utmost to commit our resources to meet your preferred schedule and therapist.</p>\r\n\r\n<h3>Redemption Instructions</h3>\r\n\r\n<ul>\r\n	<li><strong>Appointment required</strong></li>\r\n	<li>Call&nbsp;6238 6890 and quote Groupon security code</li>\r\n	<li><strong>Valid ID MUST be presented</strong></li>\r\n	<li>Cancellations and amendments allowed, at least 24 hours in advance</li>\r\n</ul>\r\n','<p>Smoking/Food/Drinks : Please note that smoking is prohibited in the spa, in accordance to Singapore Law. No outside food or drinks is allowed in the spa.<br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Valid for first time customers of RN Spa, 23 years and above</li>\r\n	<li>Valid for Singaporeans, PRs, EP and DP holders only</li>\r\n	<li>Not valid for existing package holders</li>\r\n	<li>Not valid with other promotions and discounts</li>\r\n</ul>\r\n','<p>Mobile Phones and Gadgets : As all our customers come to the spa for relaxation and rejuvenation purposes, we will appreciate that our customers can refrain from speaking loudly in the spa. Mobile phones and electronic gadgets are discouraged from being brought into the treatment areas. If it is necessary to bring them into the treatment room, please switch to silent mode. Please respect the privacy of all our customers.</p>\r\n','2015-02-26 02:23:00','2015-03-31 09:19:12'),
	(3,'<p>Personal Belongings : Our staff will guide you to change into the appropriate attire prior to the start of the treatment. Please keep all your valuables within the lockers provided. We discourage our customers from wearing or bringing jewellery/valuables during your spa visit as they may need to be removed for the treatment. The spa will not take responsibility of any losses of valuables within the spa.<br />\r\n&nbsp;</p>\r\n\r\n<h3>Redemption Instructions</h3>\r\n\r\n<ul>\r\n	<li><strong>Appointment required</strong></li>\r\n	<li>Call 6845 1161 and quote &quot;Groupon12&quot; or</li>\r\n	<li>Email hi@smbook.com<br />\r\n	with:\r\n	<ul>\r\n		<li>Name</li>\r\n		<li>Contact number</li>\r\n		<li>Preferred treatment</li>\r\n		<li>Preferred appointment date and time</li>\r\n		<li>Attached Groupon</li>\r\n	</ul>\r\n	</li>\r\n	<li>Cancellations and amendments allowed, at least 24 hours in advance</li>\r\n	<li>Customers are advised to arrive 10 min prior to scheduled appointment</li>\r\n	<li><strong>Valid ID MUST be presented</strong></li>\r\n</ul>\r\n','<ul>\r\n	<li>Valid for customers 23 years and above</li>\r\n	<li>Valid for Singaporeans and PRs only</li>\r\n	<li>Valid for first time customers and those who have not visited Amarin Spa in the past 12 months</li>\r\n	<li>Not valid for existing package holders</li>\r\n	<li>Not valid with other promotions, discounts and gift vouchers</li>\r\n	<li>Not valid for appointments on 18-20 Feb 2015</li>\r\n	<li>For request of Couple&#39;s Room, surcharge of $25 applies for appointments Mon-Fri before 5pm (excluding eve of and on PH), and surcharge of $38 applies for all other time slots (payable directly to merchant)</li>\r\n	<li>Max. 3 pax per time slo</li>\r\n</ul>\r\n\r\n<p>Medical Conditions : If you are feeling unwell, are pregnant, have high blood pressure, allergies or any other medical complaints or condition, please inform our spa consultant/therapist. This will help us recommend appropriate treatments or take necessary precautions. Please note that all treatments are taken at your own risk. If you have any doubt, please consult your doctor in advance.</p>\r\n','<p>Customer Information : Customers will need to provide customer information to enable the spa to perform internal administration and marketing activities such as contacting customers, billing etc. Customers also need to fill up a simple health questionnaire to help the spa assess your health conditions so that we are able to recommend the appropriate spa treatment for you. Please be assured that we will treat the customer information as confidential information and use the information only for the purpose of internal administration, internal marketing and monitoring purposes.</p>\r\n','2015-02-26 02:23:00','2015-03-24 02:14:55'),
	(4,'<p>Clientele : The spa offers services to both male and female clients. Separate treatment rooms (with attached shower facilities) are available for both genders.</p>\r\n\r\n<ul>\r\n	<li>Valid for customers 21 years and above</li>\r\n	<li>Valid for Singaporeans, PRs, EP, SP, DP and WP holders only</li>\r\n	<li>Valid for first time customers&nbsp;and those who have not visited Z Spa&nbsp;in the past 6 months</li>\r\n	<li>Top up of $20 per person and per massage session required for customers who have visited Z Spa in the past 6 months</li>\r\n	<li>Top up of $10 required for couple room</li>\r\n	<li>Massage and Body Treat have to be utilised on same day</li>\r\n	<li>For Two Pax&nbsp;options, both must book&nbsp;same&nbsp;appointment&nbsp;slot</li>\r\n	<li>Not valid for existing package holders</li>\r\n	<li>Not valid for appointments on 14 Feb 2015</li>\r\n</ul>\r\n','<p>Punctuality : Please arrive at the spa at least 15 minutes before the appointment time. Late arrival may result in shortening of the treatment time, as the spa needs to cater to the next customer. Should you be expected to be late, please contact the spa consultant earlier so that appropriate adjustment may be made. Please note that for all appointments made, the spa will wait for the customer for a maximum of 15 mins from the appointment time. Beyond that, the spa will give the slot up for other customers. Thus please help by contacting us at least half an hour before, should you be late for the appointment or wish to cancel it.</p>\r\n','<p>reatment Selection : The spa seeks the understanding of customers to refrain from changing their mind about the type of treatment they want after informing the spa consultant or therapist as some of the treatments require ingredient preparation and once the ingredients are prepared, we are unable to change the treatment for you.</p>\r\n','2015-02-26 02:23:00','2015-03-24 02:16:15');
INSERT INTO `service_details` (`id`, `summary`, `highlights`, `created_at`, `updated_at`)
VALUES
	(1,'<p>uses soothing, tapping and kneading strokes to work the entire body, relieving muscle tension and loosening sore joints. Swedish massage therapists use five basic strokes, which anyone can learn and use on themselves and others. They are effleurage (stroking); petrissage (muscles are lightly grabbed and lifted); friction (thumbs and fingertips work in deep circles into the thickest part of muscles); tapotement (chopping, beating, and tapping strokes); and vibration (fingers are pressed or flattened firmly on a muscle, then the area is shaken rapidly for a few seconds)<br />\r\n<img alt=\"coupon from z spa Singapore City\" src=\"http://static.sg.groupon-content.net/79/48/1422265574879.jpg\" /></p>\r\n\r\n<h3>The Merchant</h3>\r\n\r\n<p>Claim back some lost &lsquo;Z&rsquo;s at Z Spa, where the team of beauticians and massage therapists are ready to put you into full relax mode with their skillful hands that can induce a state of peace and calm. Choose from a wide range of services, from shiatsu massages that activate pressure points, to pre and post natal massages for expectant and new mothers; or keep up youthful appearances with their many facials, milk baths and moisturising body wraps.<br />\r\n&nbsp;</p>\r\n\r\n<h3>Operating Hours</h3>\r\n\r\n<p>Daily: 11am - 9pm</p>\r\n','<p>Highlights</p>\r\n\r\n<ul>\r\n	<li><strong>For 60 min Full Body Massage, choose 1 from 3 types:</strong>\r\n\r\n	<ul>\r\n		<li>Swedish - long, gliding kneads help ease nagging muscle and joint pains</li>\r\n		<li>Aromatherapy - uses essential oils to rejuvenate senses through therapeutic strokes</li>\r\n		<li>Fusion - customised to speed up the healing process that the body needs</li>\r\n	</ul>\r\n	</li>\r\n	<li><strong>For 20 min Body Treat, choose 1 from 4 types:</strong>\r\n	<ul>\r\n		<li>Back Scrub - sloughs away dead skin cells to make for smoother and silkier skin</li>\r\n		<li>Jamu Wrap - reduces bloating while toning and trimming the tummy</li>\r\n		<li>Herbal Ball - eliminates unwanted toxins and calms hyperactive nerves</li>\r\n		<li>G5 Slimming for Thighs - promotes blood circulation using a vibrating device that aids in weight loss and softens and lightens cellulite</li>\r\n	</ul>\r\n	</li>\r\n	<li>Stimulate the body&rsquo;s lymphatic system and improve blood circulation</li>\r\n	<li>Relax and rejuvenate the body</li>\r\n	<li>Skilled and friendly therapists</li>\r\n	<li>Cosy location in Serangoon Garden with nearby parking available</li>\r\n</ul>\r\n','2015-02-26 02:23:00','2015-03-24 02:14:55'),
	(2,'<p>targets chronic tension in muscles that lie far below the surface of your body. You have five layers of muscle in your back, for instance, and while Swedish massage may help the first couple of layers, it won&rsquo;t do much directly for the muscle underneath. Deep muscle techniques usually involve slow strokes, direct pressure or friction movements that go across the grain of the muscles. Massage therapists will use their fingers, thumbs or occasionally even elbows to apply the needed pressure.</p>\r\n\r\n<h3>The Merchant</h3>\r\n\r\n<p>Located within the award-winning, five-star luxury Marina Mandarin Hotel, Amarin Spa is a superior total wellness and relaxation haven, delicately combining the timeless wisdom of healing arts with the very best of contemporary spa treatments.<br />\r\n<br />\r\n<img src=\"https://img.grouponcdn.com/deal/4qBiPXZWKHPbjppL72Ew/t620x376/fN-700x420.jpg\" style=\"margin:0px; width:100%\" /><br />\r\n<br />\r\n<img src=\"https://img.grouponcdn.com/deal/qeU7PpnjwCKgCD1yTg1Y/t620x376/Bk-700x420.jpg\" style=\"margin:0px; width:100%\" /><br />\r\n&nbsp;</p>\r\n\r\n<h3>Operating Hours</h3>\r\n\r\n<p>Monday to Friday: 10am - 10pm (Last Appointment 8pm)&nbsp;<br />\r\nSaturday, Sunday and Public Holiday: 10am - 7.30pm (Last Appointment 5.30pm)</p>\r\n','<p>Highlights</p>\r\n\r\n<ul>\r\n	<li><strong>Swedish Massage</strong>&nbsp;uses light to medium pressure massage with effleurage strokes to soothe tensed muscles and rejuvenate the body</li>\r\n	<li><strong>Deep Tissue</strong>&nbsp;applies stronger pressure massage technique to &ldquo;unlock&rdquo; tension in the stiff muscle tissues and joint pain</li>\r\n	<li><strong>Ginseng Wellness Massage</strong>&nbsp;is an invigorating body massage using balm with premium Ginseng extract to stimulate the immune system, restore mental alertness, firm skin and reduce premature aging</li>\r\n	<li><strong>Manual Lymphatic Drainage Massage</strong>&nbsp;improves skin conditions like cellulite, eczema, redness and acne, and reduces pain and swelling, puffiness caused by water retention</li>\r\n	<li><strong>Tension Relief Therapy</strong>&nbsp;aids in relieving muscle tension and discomfort in the body</li>\r\n	<li>Heat Blanket eliminates waste and toxins</li>\r\n	<li>Steam Bath opens pores, increases circulation for a relaxing and healthy experience</li>\r\n	<li>Exclusive and posh spa ambience with spacious treatment rooms</li>\r\n	<li>Qualified body therapists with spa industry certifications</li>\r\n	<li>Conveniently located near Esplanade (5 min walk) and City Hall MRT (10 min walk) MRT stations</li>\r\n</ul>\r\n','2015-02-26 02:23:00','2015-03-24 02:04:33'),
	(3,'<p><br />\r\nis designed to help you train better, whether you&rsquo;re a world champion or a weekend warrior. The techniques are similar to those in Swedish and deep tissue massage, but Greene says sports massage has been adapted to meet the athlete&rsquo;s special needs. Pre-event massage can help warm up muscles and improve circulation before competition, but it can also energize or relax an athlete and help him focus on the competition. Post-event massage can push waste products out of the body and improve recovery.<br />\r\n&nbsp;</p>\r\n\r\n<h3>The Merchant</h3>\r\n\r\n<p>As its name so aptly suggests, Indulge Skin &amp; Body Lab, which was first established in 2003, is set to provide you with gorgeous pampering that will see your body re-energized and your mind refreshed. Conveniently located in the recently opened Star Vista, just next to Buona Vista MRT, this CaseTrust accredited beauty centre is incredibly easy to reach and staffed with trained professionals with ample experience in the beauty and wellness industry.&nbsp;</p>\r\n\r\n<p>&nbsp;<img alt=\"coupon from Indulge Skin &amp; Body Lab Singapore City\" src=\"http://static.sg.groupon-content.net/17/09/1421391400917.jpg\" /></p>\r\n\r\n<p><strong>For 60 min Full Body Massage, choose 1 from 4 types:</strong></p>\r\n\r\n<ul>\r\n	<li>Swedish - long, gliding strokes direct blood back to the heart for instant rejuvenation</li>\r\n	<li>Meridian Drainage - relaxes muscles, improves blood circulation and stimulates metabolic processes</li>\r\n	<li>Lymphatic Drainage - helps with ridding the body of toxins and broken down fat cells</li>\r\n	<li>Acupoint - uses the body&rsquo;s natural energy to promote metabolism, purge toxins and relieve water retention&nbsp;<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>60 min Lymphatic Detox Treatment includes:</strong></p>\r\n\r\n<ul>\r\n	<li>Back Therapy - speeds up healing for acne prone skin, reduce blemishes, and controls oil secretion</li>\r\n	<li>Guasha - improves &lsquo;Qi&rsquo; flows and relieves nagging muscle tension</li>\r\n	<li>Moxibustion Treatment - Clears blockages within vessels and muscles while increasing blood supply</li>\r\n	<li>Qi Cupping Therapy - draws out unwanted toxins out of the body for a fresher feeling inside and out</li>\r\n	<li>Lymphatic Drainage Therapy - rids the body of toxins and breaks down fat cells</li>\r\n	<li>Essential Oil Therapy - affords pain relief and increased circulation using relaxing essential&nbsp;</li>\r\n</ul>\r\n','<p>&nbsp;</p>\r\n\r\n<p>Highlights</p>\r\n\r\n<ul>\r\n	<li><strong>For 60 min Full Body Massage, choose 1 from 4 types:</strong>\r\n\r\n	<ul>\r\n		<li>Swedish</li>\r\n		<li>Meridian Drainage</li>\r\n		<li>Lymphatic Drainage</li>\r\n		<li>Acupoint</li>\r\n	</ul>\r\n	</li>\r\n	<li><strong>60 min Lymphatic Detox Treatment includes:</strong>\r\n	<ul>\r\n		<li>Back Therapy</li>\r\n		<li>Guasha</li>\r\n		<li>Moxibustion Treatment</li>\r\n		<li>Qi Cupping Therapy</li>\r\n		<li>Lymphatic Drainage Therapy</li>\r\n		<li>Essential Oil Therapy</li>\r\n	</ul>\r\n	</li>\r\n	<li>Professionally trained therapists</li>\r\n	<li>Located at The Star Vista, within walking distance from Buona Vista MRT</li>\r\n</ul>\r\n','2015-02-26 02:23:00','2015-03-24 02:16:15'),
	(4,'<p>is a form of deep tissue massage that is applied to individual muscles. It is used to increase blood flow, reduce pain and release pressure on nerves caused by injuries to muscles and other soft tissue. Neuromuscular massage helps release trigger points, intense knots of tense muscle can also &ldquo;refer&rdquo; pain to other parts of the body. Relieving a tense trigger point in your back, for example, could help ease pain in your shoulder or reduce headaches.</p>\r\n\r\n<h3>The Deal</h3>\r\n\r\n<p><strong>For Full Body Massage, choose 1 from 6 types:</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Aromatherapy Massage</strong>&nbsp;- breathe in fragrant essential oils as muscle and joint stress are kneaded away by relaxing strokes</li>\r\n	<li><strong>Deep Tissue Massage</strong>&nbsp;- rejuvenates weary bodies and improves mobility, posture and physical performance.</li>\r\n	<li><strong>Swedish Massage</strong>&nbsp;- uses long, gliding strokes that gently knead away kinks and knots in muscles.</li>\r\n	<li><strong>Detox Massage</strong>&nbsp;- locates and susses out knotted muscles while ridding physiques of unwanted toxins</li>\r\n	<li><strong>Crevice Massage</strong>&nbsp;- focuses on the abdominal area to expel winds in the stomach and provides women&rsquo;s uterine and ovary protection</li>\r\n	<li><strong>Hot Stone Massage</strong>&nbsp;- positions smooth, heated stones on backsides to enhance blood circulation and relieve muscle tension&nbsp;<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<h3>The Merchant</h3>\r\n\r\n<p>Highly respected and renowned as one of the leading wellness hubs in the industry since 2008, Pure Angel Spa specialises in unfiltered relaxation, rejuvenation, and result-driven beauty treatments. This cosily inviting urban retreat also boasts owning state-of-the art equipment and housing highly qualified staff for a truly heavenly experience. Comprehensive beauty services include nourishing face and body treatments, rejuvenating massages and wow-w