	(5,'<h3>The Deal</h3>\r\n\r\n<p><strong>For 60 min Tuina TCM Full Body Massage, choose 1 from 5 types:</strong></p>\r\n\r\n<ul>\r\n	<li>Tuina Massage - medically pampering massage style involving specialised pushing and grasping moves</li>\r\n	<li>Sports Injury Massage - relieves muscle pains and regains sports performance and fitness</li>\r\n	<li>Meridian Acupoint Massage - aids in detoxification, reduces congestion and increases metabolism</li>\r\n	<li>Deep Tissue Massage - combines stretching and strong compression techniques to alleviate muscle stress</li>\r\n	<li>Pains &amp; Aches Probing Massage - targets nagging pain areas and melts away any traces of discomfort&nbsp;<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>For 20 min Body Treatment, choose 1 from 3 types:</strong></p>\r\n\r\n<ul>\r\n	<li>Cupping - boosts energy flow and clears stagnant blood</li>\r\n	<li>GuaSha - eliminates impurities and removes blood stagnation</li>\r\n	<li>Acupuncture - relieves pain, stress, insomnia, migraines and high blood pressure&nbsp;<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<h3>The Merchant</h3>\r\n\r\n<p>Established in 1997 as Singapore&rsquo;s first integrated Traditional Chinese Medicine and healthcare centre, Chinese Medical Centre is fast becoming a one-stop place for a variety of quality services related to Chinese medicine, healthcare massage, and acupuncture. World-weary patrons can take a step back in time and tap on the experience and knowledge of a team of TCM veterans who will provide one with &ldquo;World-class standard&rdquo; remedies and more. With a Comprehensive Management Networking System up and running, the road to wellness is just a click away as patrons can now make a booking online.&nbsp;<br />\r\n<br />\r\n<img src=\"https://img.grouponcdn.com/deal/8BKCyLVPfMqhyj2hdWS4/t620x376/fE-700x420.jpg\" style=\"margin:0px; width:100%\" /><br />\r\n<img alt=\"coupon from Chinese Medical Centre Spa &amp; Wellness\" src=\"http://static.sg.groupon-content.net/89/