	(6,'<h3>The Merchant</h3>\r\n\r\n<p>Centrally located in town, RN Spa is a one-stop solution for one&rsquo;s beauty and wellness needs. The friendly and trained therapists are experienced professionals who are dedicated in placing a customer&rsquo;s wellness as their priority. The salon houses a myriad of treatments available for the face, body and feet, as well as increasingly popular cupping and candling treatments.<br />\r\n<br />\r\n<img src=\"https://img.grouponcdn.com/deal/iLsc4zhkE6rZtLfP5ASV/t620x376/6F-700x420.jpg\" /><img src=\"https://img.grouponcdn.com/deal/cW2b4tjp4pYDN55CopXv/t620x376/Po-700x420.jpg\" /></p>\r\n','<p>Highlights</p>\r\n\r\n<ul>\r\n	<li><strong>Green Ocha Massage</strong>&nbsp;is a green tea infused, body relief massage for the ultimate relaxing experience</li>\r\n	<li><strong>Chimu Body Harmoniser Massage</strong>\r\n	<ul>\r\n		<li>Holistic body and womb harmonising remedy combines healing properties of traditional herbs</li>\r\n		<li>Promotes good gynecologic health, strengthens body&rsquo;s immune system and achieves hormonal balance</li>\r\n		<li>Increases blood circulation to uterus and regulates menstrual cycle</li>\r\n	</ul>\r\n	</li>\r\n	<li>Rejuvenating treatments that help improve blood circulation, as well as overall well-being</li>\r\n	<li>Wellness of customers is a priority</li>\r\n	<li>19 treatment ensuites, sprawling 6200 square feet</li>\r\n	<li>Modern technology in comfortable, rustic setting</li>\r\n	<li>Located near Somerset and Dhoby Ghaut MRT stations</li>\r\n</ul>\r\n','2015-02-26 02:23:00','2015-03-24 01:52:28'),
	(7,'<p>focuses on the skull and spinal column. Therapists use very gently pressure no more than the weight of a nickel to massage the bones, membranes and fluids that support and bathe your skull and spinal column. The theory is that these manipulations will reduce tension and counteract any physical trauma you may have experienced to your head over the years<br />\r\n&nbsp;</p>\r\n\r\n<h3>The Deal</h3>\r\n\r\n<p><strong>For Facial, choose 1 from 3 types:</strong></p>\r\n\r\n<ul>\r\n	<li>Signature Brightening Facial - thoroughly clears pores to achieve a noticeably luminous glow</li>\r\n	<li>Signature Collagen Facial - stimulates skin tissue repair and collagen regeneration for better, taut skin</li>\r\n	<li>Signature RF Facial - utilises radio frequency waves that lifts and firms up saggy skin naturally&nbsp;<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>For Massage, choose 1 from 3 types:</strong></p>\r\n\r\n<ul>\r\n	<li>Salt Stone Massage - cools off body while relieving discomfort associated with hot temperatures or hot flashes</li>\r\n	<li>Balinese Massage - stimulates the nervous system, which enhances moods, as well as heightens the sense of wellness</li>\r\n	<li>Hot Oil Massage - soothes, relaxes and alleviates nagging muscle tensions&nbsp;<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>For Treat, choose between 2 types:</strong></p>\r\n\r\n<ul>\r\n	<li>Ear Candling - relieves sinus pressure and pain, as well as helps in lymphatic circulation</li>\r\n	<li>Hot Stone Eye Treatment - diminishes puffiness of the eyes and tension lines&nbsp;<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<h3>The Merchant</h3>\r\n\r\n<p>Offering the perfect blend of face and body pampering treats, Belle De Beaute beauty and wellness salon delights patrons with a variety of treatments and services fit for royalty. Kick back and relax at the luxurious spa and have tense knots and muscles relieved with a full body massage, a facial for supply skin to resurface, or spa session and be rejuvenated in no time. Housed with professionally trained beauty and wellness therapists, the spa offers patrons a relaxing and therapeutic environment.&nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<h3>Operating Hours</h3>\r\n\r\n<p>Monday to Friday: 11am - 8.30pm (Last appointment: 6pm)&nbsp;<br />\r\nSaturday and Sunday: 10.30am - 7pm (Last appointment: 4pm)</p>\r\n','<p>Highlights</p>\r\n\r\n<ul>\r\n	<li><strong>2.5 Hr Relaxing Spa Indulgence includes:</strong>\r\n\r\n	<ul>\r\n		<li>60 min Massage</li>\r\n		<li>60 min Facial</li>\r\n		<li>30 min Treat</li>\r\n	</ul>\r\n	</li>\r\n	<li>Rejuvenate body, mind and soul with an indulgent spa package</li>\r\n	<li>Aids in deep relaxation, improved sleep and restore the balance of the central nervous system</li>\r\n	<li>Skilled and professional therapists</li>\r\n	<li>Located along Tampines Street, 2 minutes away from Tampines Interchange by bus</li>\r\n	<li>CaseTrust certified</li>\r\n</ul>\r\n','2015-02-26 02:23:00','2015-03-31 09:19:12'),
	(8,'<p>Spa Symphony&rsquo;s customized facial uses natural and organic ingredients from France. Choose from 3 customized facials that are designed to tackle specific beauty and skin needs. For those suffering from dull and dry skin, Shea Hydration Facial is guaranteed to nourish and hydrate the skin to relieve tightness and fine lines. Put a brake on ageing with Centella Collagen Facial, where fines lines are smoothed and plumped, leaving one with a youthful glow. Lastly, Geranium Whitening Facial is designed to moisturize, firm and brighten skin to a radiant glow, suitable for those with dull and uneven skin tone.&nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>Detox Therapy (with facial)</strong><br />\r\n<br />\r\nEnjoy 2 additional therapies in the sensory room - Chromotherapy + Whole Body Vibration Therapy&nbsp;<br />\r\n<br />\r\nChromotherapy (Color Therapy) is a form of &lsquo;vibrational&rsquo; healing therapy that utilizes the beneficial effects of different colors to aid healing. Choose the color that suits your current mood and enjoy its unique healing properties in the sensory room. Body Vibration Therapy is designed to de-stress, improve detoxification and blood circulation resulting in bringing back that natural glow in one&rsquo;s skin.&nbsp;<br />\r\n<br />\r\n<strong>De-Stress Eye Treatment with Advanced Machine Add-on (with facial)</strong>&nbsp;<br />\r\nGet rid of unsightly dark circles, eye bags and under eye wrinkles with this Bright Eye Treatment tailored to prevent premature aging by restoring collagen production while retaining the essential moisture around the eye area.&nbsp;<br />\r\n<br />\r\n<strong>Advanced Machine Add-on, choice of one:</strong>&nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>Light Heat Energy (LHE)</strong><br />\r\n	State-of-the-art technology, Light Heat Energy (LHE) uses pulsed light and heat energy to lighten pigmented spots and vascular lesions while decreasing pore size, erasing fine lines and wrinkles. LHE photo-rejuvenation is also effective for homogenizing skin tone, collagen renewal and skin tightening.&nbsp;<br />\r\n	&nbsp;</li>\r\n	<li><strong>Diamond Microdermabrasion</strong><br />\r\n	Non-invasive exfoliating technique works to remove the outermost layer of dead skin cells from the epidermis resulting in the removal of fine lines and wrinkles; helps to smooth textured skin; reduces scarring; decreases pore size and lightens superficial hyperpigmentation, commonly known as age spots. Diamond Microdermabrasion also helps promote new cell regeneration for healthy, glowing skin.&nbsp;<br />\r\n	&nbsp;</li>\r\n	<li><strong>Cryotherapy</strong><br />\r\n	Latest freeze technology &lsquo;chills&rsquo; the skin surface to stimulate microcirculation and increase cellular oxygenation resulting in improved skin tone and texture; collagen synthesis; instant lifting and a radiant skin tone. Additionally, skin&rsquo;s pore size is reduced, keeping toxins, dirt and grime out. It also flushes away built up toxins in the skin and soothes inflammation, eliminating dreaded puffiness.&nbsp;<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<h3>The Merchant</h3>\r\n\r\n<p>A team of spa veterans&rsquo; years of experience and passion for bringing relaxation into peoples&rsquo; lives helped the founding of Spa Symphony. Here, a variety of services is offered, including massages, chiropractic healthcare, organic skin care solutions and slimming treatments. High-quality products and a highly therapeutic spa environment aid in a multi-sensory experience, allowing clients to relax thoroughly as well as benefit from the effects of rich, effective solutions<br />\r\n<br />\r\n<img src=\"https://img.grouponcdn.com/deal/g5FZRSTjUrXMkubRb9u9/t620x376/w5-700x420.jpg\" /><br />\r\n<img src=\"https://img.grouponcdn.com/deal/4gmWyjz684vh5j69p7ji/t620x376/55-700x420.jpg\" /><img src=\"https://img.grouponcdn.com/deal/mHn5t1VS8gSAUy2JugUQ7D/t620x376/2-700x420.jpg\" /></p>\r\n','<p>Highlights</p>\r\n\r\n<ul>\r\n	<li><strong>Award Winning Spa</strong>&nbsp;Best in Beauty Spa award 2014 by Singapore Women&rsquo;s Weekly</li>\r\n	<li>Choose from 3 Customized Facials:\r\n	<ul>\r\n		<li>Shea Hydration Facial</li>\r\n		<li>Centella Collagen Facial</li>\r\n		<li>Geranium Whitening Facial</li>\r\n	</ul>\r\n	</li>\r\n	<li>De-stress Eye Treatment + Advanced machine add-on option available</li>\r\n	<li>De-stress Eye Treatment fights against dark circles, puffiness and fine lines for a new youthful look</li>\r\n	<li>Advanced machine add-on includes choice of:&nbsp;<strong>Light Heat Energy (LHE)</strong>&nbsp;or&nbsp;<strong>Diamond Microdermabrasion</strong>&nbsp;or<strong>Cryotherapy</strong></li>\r\n	<li>Detox Therapy includes Chromotherapy and Whole Body Vibration Therapy.</li>\r\n	<li>Relax in a quartz healing lounge and enjoy specially blended tea to complete your spa experience.</li>\r\n	<li>Therapists are friendly and experienced with industrial certificates</li>\r\n	<li>Conveniently located along Orchard Road</li>\r\n</ul>\r\n','2015-02-26 02:23:00','2015-03-24 01:33:22'),
	(9,'<p>uses gentle, rocking massage to help release the body&rsquo;s harmful &ldquo;holding patterns.&rdquo; If you injured your left shoulder as a child, for example, you still may unconsciously carry it lower than your right shoulder, throwing your body off balance and robbing you of energy. Therapists employ very light, gentle shaking techniques that are unlike traditional Swedish-style massage. The idea is to make people more aware of their bodies, especially the way they move and hold themselves. For some reason, freeing people of physical holding patterns also seems to rid them of emotional stress that they associated with the prior injury.<br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<h3>The Deal</h3>\r\n\r\n<p><strong>For 60 min Full Body Massage, choose 1 from 4 types:</strong></p>\r\n\r\n<ul>\r\n	<li>Javanese - relieves migraines, sinus, swimmers ears and allergy problems</li>\r\n	<li>Aromatherapy - uses fragrant essential oils and increases blood, oxygen and energy flow</li>\r\n	<li>Deep Tissue - utilises rigorous strokes and direct pressure to alleviate aches and pains</li>\r\n	<li>Tuina - focuses on rhythmic compression along energy channels of the body that manipulate and lubricate the joints&nbsp;<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<p><strong>For Premium Treats, choose from 4 types:</strong></p>\r\n\r\n<ul>\r\n	<li>Hot Stone Therapy - heated stones reduces back pain and aches, arthritis, insomnia and stress.</li>\r\n	<li>Guasha - aids in improving &lsquo;Qi&rsquo; flows, relieving tension, and restoring normal metabolic processes.</li>\r\n	<li>Jamu Tummy Treatment - helps flatten bulging bellies and significantly reduces bloatedness</li>\r\n	<li>Relaxing Back Scrub - deeply rejuvenates senses while exfoliating away dead skin&nbsp;<br />\r\n	&nbsp;</li>\r\n</ul>\r\n\r\n<h3>The Merchant</h3>\r\n\r\n<p>Centrally stationed in a convenient distance from Serangoon MRT station, The Organic Spa is the country&rsquo;s eco-friendly spa that offers a holistic approach to body wellness and skincare. Using organic products and lotions with aromatherapy as you renew, revitalise and invigorate your senses, this wellness centre&rsquo;s aim is to make sure customers relax and get lost in pure bliss with every visit. Additionally, The Organic Spa&rsquo;s specialties are the Maternity Therapy and Signature Massages, which mainly consists of traditional techniques from the ancient times of Japanese and Chinese origin.<br />\r\n<br />\r\n<img src=\"https://img.grouponcdn.com/deal/oBYJFpyGJmt9mbQ2efoX/t620x376/rp-700x420.jpg\" style=\"margin:0px; width:100%\" /><br />\r\n<br />\r\n<img src=\"https://img.grouponcdn.com/deal/6LazTg5iD8HHKBKgzNLB/t620x376/WD-700x420.jpg\" style=\"margin:0px; width:100%\" /><br />\r\n&nbsp;</p>\r\n\r\n<h3>Operating Hours</h3>\r\n\r\n<p>Monday to Friday: 12pm - 9pm&nbsp;<br />\r\nSaturday, Sunday and Public Holiday: 10am - 7pm</p>\r\n','<p>Highlights</p>\r\n\r\n<ul>\r\n	<li><strong>For 60 min Full Body Massage, choose 1 from 4 types:</strong>\r\n\r\n	<ul>\r\n		<li>Javanese</li>\r\n		<li>Aromatherapy</li>\r\n		<li>Deep Tissue</li>\r\n		<li>Tuina</li>\r\n	</ul>\r\n	</li>\r\n	<li><strong>For Premium Treats, choose from 4 types:</strong>\r\n	<ul>\r\n		<li>Hot Stone Therapy</li>\r\n		<li>Guasha</li>\r\n		<li>Jamu Tummy Treatment</li>\r\n		<li>Relaxing Back Scrub</li>\r\n	</ul>\r\n	</li>\r\n	<li>Uses certified organic products</li>\r\n	<li>Professionally trained and certified therapists to provide personally-suited massage experience</li>\r\n	<li>Extensive range of custom-tailored massage services</li>\r\n	<li>Relaxing, homely and rejuvenating environment</li>\r\n</ul>\r\n','2015-02-26 02:23:00','2015-03-24 02:13:09');
