INSERT INTO `terms_conditions` (`id`, `description`, `configure_no`, `created_at`, `updated_at`)
VALUES
	(1,'Through the website, we (http://booking.enablestartup.com B.V. and its affiliate (distribution) partners) provide an online platform through which all types of temporary accommodations (for example hotels, motels, hostels and bed & breakfasts, collectively the \"accommodation(s)\"), can advertise their rooms for reservation, and through which visitors to the website can make such reservations. By making a reservation through http://booking.enablestartup.com, you enter into a direct (legally binding) contractual relationship with the accommodation provider at which you book. From the point at which you make your reservation, we act solely as an intermediary between you and the provider, transmitting the details of your reservation to the relevant accommodation provider and sending you a confirmation email for and on behalf of the accommodation provider.\n\nWhen rendering our services, the information that we disclose is based on the information provided to us by accommodation providers. As such, the accommodation providers are given access to an extranet through which they are fully responsible for updating all rates, availability and other information which is displayed on our website. Although we will use reasonable skill and care in performing our services we will not verify if, and cannot guarantee that, all information is accurate, complete or correct, nor can we be held responsible for any errors (including manifest and typographical errors), any interruptions (whether due to any (temporary and/or partial) breakdown, repair, upgrade or maintenance of our website or otherwise), inaccurate, misleading or untrue information or non-delivery of information. Each accommodation provider remains responsible at all times for the accuracy, completeness and correctness of the (descriptive) information (including the rates and availability) displayed on our website. Our website does not constitute and should not be regarded as a recommendation or endorsement of the quality, service level, qualification or (star) rating of any accommodations made available.\n\nOur services are made available for personal and non-commercial use only. Therefore, you are not allowed to re-sell, deep-link, use, copy, monitor (e.g. spider, scrape), display, download or reproduce any content or information, software, products or services available on our website for any commercial or competitive activity or purpose.','1. Scope of our Service','2015-02-26 02:23:00','2015-02-26 02:23:00'),
	(2,'The prices on our site are highly competitive. All prices on the http://booking.enablestartup.com website are per room for your entire stay and are displayed including VAT tax and all other taxes (subject to change of such taxes), unless stated differently on our website or in the confirmation email.\n\nSometimes cheaper rates are available on our website for a specific stay at a property, however, these rates made by accommodations providers may carry special restrictions and conditions, for example in respect to cancellation and refund. Please check the room and rate details thoroughly for any such conditions prior to making your reservation.\n\nIn the event of a crossed-out rate, we look at the prices currently being charged by the property in the 30-day window around your proposed check-in date. From the prices within this window, we display the third-highest price on offer as the crossed-out rate. To ensure we are making a fair comparison, we always use the same reservation conditions (meal plan, cancellation policy and room type). This means that you get the same room for a lower price compared to other check-in dates at the same time of year.\n\nWe want you to pay the lowest price possible for your stay. Should you find your accommodation, with the same reservation conditions, at a lower rate on the Internet after you have made a reservation through us, we will match the difference between our rate and the lower rate under the terms and conditions of the Best Price Guarantee.\n\nThe currency converter is for information purposes only and should not be relied upon as accurate and real time; actual rates may vary.\n\nObvious errors and mistakes (including misprints) are not binding.\n\nAll special offers and promotions are marked as such.','2. Prices and Best Price Guarantee','2015-02-26 02:23:00','2015-02-26 02:23:00'),
	(3,'Our service is free of charge because, unlike many other parties, we will not charge you for our service or add any additional (reservation) fees to the room rate.','3. Free of Charge','2015-02-26 02:23:00','2015-02-26 02:23:00'),
	(4,'SMbook.com respects your privacy. Please take a look at our privacy and cookies policy for further information','4. Privacy and Cookies','2015-02-26 02:23:00','2015-02-26 02:23:00'),
	(5,'If applicable and available, certain accommodation providers offer the opportunity for reservations to be paid (wholly or partly and as required under the payment policy of the accommodation) to the accommodation provider during the reservation process by means of secure online payment (all to the extent offered and supported by your bank). Payment is safely processed from your credit/debit card or bank account to the bank account of the accommodation provider through a third party payment processor.\n\nFor certain rates or special offers, please note that your credit card may be pre-authorized or charged (sometimes without any option for refund) upon reservation and confirmation of the booking. Please check the room details thoroughly for any such conditions prior to making your reservation.\n\nIn the event of credit card fraud or unauthorized use of your credit card by third parties, most banks and credit card companies bear the risk and cover all the charges resulting from such fraud or misuse, which may sometimes be subject to a deductible (usually set at EUR 50 (or the equivalent in your local currency)). In the event that your credit card company or bank charges you the deductible because of unauthorized transactions resulting from a reservation made on our website, we will pay you this deductible, up to an aggregate amount of EUR 50 (or the equivalent in your local currency). In order to be indemnified, please make sure that you report this fraud to your credit card provider (in accordance with its reporting rules and procedures) and contact us immediately by email (customer.relations@http://booking.enablestartup.com). Please state \'credit card fraud\' in the subject line of your email and provide us with evidence of the charged deductible (e.g. policy of the credit card company). This indemnification only applies to credit card reservations made using http://booking.enablestartup.com\'s secure server and the unauthorized use of your credit card resulting through our default or negligence and through no fault of your own while using the secure server.','5. Credit Card','2015-02-26 02:23:00','2015-02-26 02:23:00'),
	(6,'By making a reservation with an accommodation provider, you accept and agree to the relevant cancellation and no-show policy of that accommodation provider, and to any additional (delivery) terms and conditions of the accommodation provider that may apply to your reservation or during your stay, including for services rendered and/or products offered by the accommodation provider (the delivery terms and conditions of an accommodation provider can be obtained with the relevant accommodation provider). The general cancellation and no-show policy of each accommodation provider is made available on our website on the accommodation information pages, during the reservation procedure and in the confirmation email. Please note that certain rates or special offers are not eligible for cancellation or change. Please check the room details thoroughly for any such conditions prior to making your reservation. Please note that a reservation which requires down payment or (wholly or partly) prepayment may be cancelled (without a prior notice of default or warning) insofar the relevant (remaining) amount(s) cannot be collected in full on the relevant payment date in accordance with the relevant payment policy of the accommodation and the reservation. Late payment, wrong bank, debit or credit card details, invalid credit/debit cards or insufficient funds are for your own risk and account and you shall not be entitled to any refund of any (non-refundable) prepaid amount unless the accommodation agrees or allows otherwise under its (pre)payment and cancellation policy.\n\nIf you wish to review, adjust or cancel your reservation, please revert to the confirmation email and follow the instructions therein. Please note that you may be charged for your cancellation in accordance with the accommodation provider\'s cancellation, (pre)payment and no-show policy or not be entitled to any repayment of any (pre)paid amount. We recommend that you read the cancellation, (pre)payment and no-show policy of the accommodation provider carefully prior to making your reservation and remember to make further payments on time as may be required for the relevant reservation.','6. Cancellation','2015-02-26 02:23:00','2015-02-26 02:23:00'),
	(7,'By completing a booking, you agree to receive (i) an email which we may send you shortly prior to your arrival date, giving you information on your destination and providing you with certain information and offers (including third party offers to the extent that you have actively opted in for this information) relevant to your reservation and destination, and (ii) an email which we may send to you promptly after your stay inviting you to complete our guest review form. Please see our privacy and cookies policy for more information about how we may contact you.','7. Further Correspondence','2015-02-26 02:23:00','2015-02-26 02:23:00'),
	(8,'The default setting of the ranking of hotels on our website is \"Recommended\" (or any similar wording) (the \"Default Ranking\"). For your convenience, we also offer other ways to rank the hotel. Please note that the Default Ranking is created through a fully automated ranking system (algorithm) and is based on multiple criteria.\n\nThe completed guest review may be (a) uploaded onto the relevant property\'s information page on our website for the sole purpose of informing (future) customers of your opinion of the service (level) and quality of the accommodations, and (b) (wholly or partly) used and placed by http://booking.enablestartup.com at its sole discretion (e.g. for marketing, promotion or improvement of our service) on our website or such social media platforms, newsletters, special promotions, apps or other channels owned, hosted, used or controlled by http://booking.enablestartup.com. We reserve the right to adjust, refuse or remove reviews at our sole discretion. The guest review form should be regarded as a survey and does not include any (further commercial) offers, invitations or incentives whatsoever.','8. Ranking and Guest Reviews','2015-02-26 02:23:00','2015-02-26 02:23:00'),
	(9,'To the extent permitted by law, these terms and conditions and the provision of our services shall be governed by and construed in accordance with Dutch law and any dispute arising out of these general terms and conditions and our services shall exclusively be submitted to the competent courts in Amsterdam, the Netherlands.\n\nThe original UK English version of these terms and conditions may have been translated into other languages. The translated version is a courtesy and office translation only and you cannot derive any rights from the translated version. In the event of a dispute about the contents or interpretation of these terms and conditions or inconsistency or discrepancy between the UK English version and any other language version of these terms and conditions, the UK English language version to the extent permitted by law shall apply, prevail and be conclusive. The UK English version is available on our website (by selecting UK English language) or shall be sent to you upon your written request.\n\nIf any provision of these terms and conditions is or becomes invalid, unenforceable or non-binding, you shall remain bound by all other provisions hereof. In such event, such invalid provision shall nonetheless be enforced to the fullest extent permitted by applicable law, and you will at least agree to accept a similar effect as the invalid, unenforceable or non-binding provision, given the contents and purpose of these terms and conditions.','9. Miscellaneous','2015-02-26 02:23:00','2015-02-26 02:23:00');
